import React from 'react';
import Sidebar from './Sidebar'
const Dashborad = () => {
    return(
        <div className="col-md-12">
            <div className="row">
                <div className="col-md-2">
                    <Sidebar />
                </div>
                <div className="col-md-10">
                    <h1>Dashbord</h1>
                </div>    
            </div>    
        </div>    
    )
}
